import './Home.css';
import React, { useEffect } from 'react';

function Home() {
  useEffect(() => {
    window.scrollTo({
      top: document.documentElement.scrollHeight,
      behavior: 'smooth',
    });
  }, []);

  return (
    <section className="home">
      <h1>Welcome to My Portfolio</h1>
      <p>My Name is Mridul Das and I am a learning Front End Designer.</p>
    </section>
  );
};

export default Home;
